INSERT INTO `v1_36b232c703d386c42394a8f6c0e4b212b010467696dcd07e541b83c322b89a17` VALUES (1, "訓練はまだ\nここからですわ", 3000, 1000, 2, "vo_minigame_1013_icon_2_002_001", 2, 2, "調子が上がって\nきたなっ", "vo_minigame_1013_icon_1_002_001");
INSERT INTO `v1_36b232c703d386c42394a8f6c0e4b212b010467696dcd07e541b83c322b89a17` VALUES (2, "クスクス、悪くない\n流れですわね", 3000, 5000, 2, "vo_minigame_1013_icon_2_003_001", 2, 2, "ほらほら、\nまだいけるだろ？", "vo_minigame_1013_icon_1_003_001");
INSERT INTO `v1_36b232c703d386c42394a8f6c0e4b212b010467696dcd07e541b83c322b89a17` VALUES (3, "すばらしい\n記録ですわ", 3000, 10000, 3, "vo_minigame_1013_icon_2_004_001", 2, 2, "へへっ、おまえら\nやるじゃねえか！", "vo_minigame_1013_icon_1_004_001");
INSERT INTO `v1_36b232c703d386c42394a8f6c0e4b212b010467696dcd07e541b83c322b89a17` VALUES (4, "乗りに乗って\nいますわね", 3000, 10000, 3, "vo_minigame_1013_icon_2_005_001", 2, 3, "あたしたちはまだ\n止まらねえぜ！", "vo_minigame_1013_icon_1_005_001");
INSERT INTO `v1_36b232c703d386c42394a8f6c0e4b212b010467696dcd07e541b83c322b89a17` VALUES (5, "まだまだ行きます\nついてきなさい", 3000, 10000, 3, "vo_minigame_1013_icon_2_005_002", 2, 3, "見てろよ！\nマコト班の快進撃だ！", "vo_minigame_1013_icon_1_005_002");
INSERT INTO `v1_36b232c703d386c42394a8f6c0e4b212b010467696dcd07e541b83c322b89a17` VALUES (6, "エリコ班の\n本領発揮ですわ！", 3000, 10000, 3, "vo_minigame_1013_icon_2_005_003", 2, 3, "うおぉぉっ！\n絶好調だぜ！", "vo_minigame_1013_icon_1_005_003");
INSERT INTO `v1_36b232c703d386c42394a8f6c0e4b212b010467696dcd07e541b83c322b89a17` VALUES (7, "ここからは\n前人未到の領域です！", 3000, 0, 3, "vo_minigame_1013_icon_2_006_001", 2, 4, "どこまで行けるか\n楽しみだなっ！", "vo_minigame_1013_icon_1_006_001");
